import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { auth } from '../firebase';
import { MenuIcon } from '@heroicons/react/outline'; // Importing the menu icon

const Navbar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const navigate = useNavigate(); // State to track menu open/close

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen); // Toggle the menu state
  };

  const handleLogout = async () => {
    try {
      await auth.signOut();
      navigate('/');
    } catch (error) {
      console.error('Error signing out:', error);
    }
  };

  return (
    <nav className="bg-gray-800">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex items-center justify-between h-16">
          <div className="flex items-center">
            <div className="flex-shrink-0">
              <span className="text-white font-bold text-lg">Admin Dashboard</span>
            </div>
            <div className="hidden md:block">
              <div className="ml-10 flex items-baseline space-x-4">
                <NavLink to="/Dashboard">Dashboard</NavLink>
                <NavLink to="/CourseForm">Courses</NavLink>
                <NavLink to="/AddUsers">Users</NavLink>
                <NavLink to="/BlogForm">Blog</NavLink>
                <NavLink to="/MoreAddForm">More</NavLink>
                <NavLink to="/DownloadPage">Download Data</NavLink> {/* Add DownloadPage link */}
              </div>
            </div>
          </div>
          {/* Logout button */}
          <div className="hidden md:block">
            <button
              onClick={handleLogout}
              className="bg-red-500 hover:bg-red-600 text-white py-2 px-4 rounded-md"
            >
              Logout
            </button>
          </div>
          {/* Menu button for mobile view */}
          <div className="md:hidden flex items-center">
            <button
              onClick={toggleMenu}
              className="text-gray-400 hover:text-white focus:outline-none focus:text-white"
              aria-label="Open menu"
            >
              <MenuIcon className="h-6 w-6" />
            </button>
          </div>
        </div>
      </div>
      {/* Mobile menu */}
      {isMenuOpen && (
        <div className="md:hidden">
          <div className="px-2 pt-2 pb-3 sticky space-y-1 sm:px-3">
            <NavLinkMobile to="/Dashboard" onClick={toggleMenu}>
              Dashboard
            </NavLinkMobile>
            <NavLinkMobile to="/CourseForm" onClick={toggleMenu}>
              Courses
            </NavLinkMobile>
            <NavLinkMobile to="/AddUsers" onClick={toggleMenu}>
              Users
            </NavLinkMobile>
            <NavLinkMobile to="/BlogForm" onClick={toggleMenu}>
              Blog
            </NavLinkMobile>
            <NavLinkMobile to="/MoreAddForm" onClick={toggleMenu}>
              More
            </NavLinkMobile>
            <NavLinkMobile to="/DownloadPage" onClick={toggleMenu}> {/* Add DownloadPage link */}
              Download Data
            </NavLinkMobile>
            {/* Logout button for mobile view */}
            <div className="px-2 pt-2 pb-3">
              <button
                onClick={handleLogout}
                className="bg-red-500 hover:bg-red-600 text-white py-2 px-4 rounded-md"
              >
                Logout
              </button>
            </div>
          </div>
        </div>
      )}
    </nav>
  );
};

// NavLink component for desktop view
const NavLink = ({ to, children }) => {
  return (
    <Link
      to={to}
      className="text-gray-300 hover:bg-gray-700 hover:text-white px-3 py-2 rounded-md text-sm font-medium"
    >
      {children}
    </Link>
  );
};

// NavLink component for mobile view
const NavLinkMobile = ({ to, children, onClick }) => {
  return (
    <Link
      to={to}
      onClick={onClick}
      className="text-gray-300 hover:bg-gray-700 hover:text-white block px-3 py-2 rounded-md text-base font-medium"
    >
      {children}
    </Link>
  );
};

export default Navbar;
